/* Add here all your JS customizations */
$(document).ready(function () {
    var a = 0;
    $('.numbers-section .number')
        .each(function () {

            $(this) // immediately hide element
                .waypoint(function (direction) {
                    if (a < 4) {
                        if (direction === 'down') {
                            var myNumber = $(this.element).text();

                            $(this.element).animateNumber({number: myNumber}, 1000);
                            // $(this.element).animate({ opacity: 1 });
                        }
                        a = a + 1;
                        console.log(a);


                    }
                }, {
                    offset: 'bottom-in-view'
                });
        });

    function initPagination(){
        let PagenationContainer = $('#pagination-container');
        if (PagenationContainer.length === 0) {
            return;
        }
        let next_link = PagenationContainer.find('ul.pagination li.next a');
        if (next_link.length === 0){
            return;
        }
        let pagination_main = PagenationContainer.find('.wrap_pagination');
        let pag_append = $('<div class="text-center"><a href="javascript:void(0)" class="btn btn-gold catalog-linked-inline more_goods"> </a></div>');
        pag_append.insertAfter(pagination_main);

        PagenationContainer.on('click','a.more_goods', function () {
            let ajaxurl = PagenationContainer.find('ul.pagination li.next a').attr('href');
            if(ajaxurl!==undefined){
                $.ajax({
                    type: "POST",
                    url: ajaxurl,
                    data: {'ajax_get_page': 'y'},
                    dataType: "html",
                    success: function (data) {
                        let $data = $(data);
                        $data.find('.catalog.sections').remove();
                        let AppendLi = $data.find('.catalog,.services').find('.row.items > div');
                        let Pagination = $data.find('.pagination').html();
                        PagenationContainer.find('.catalog,.services').find('.row.items').append(AppendLi);
                        PagenationContainer.find('.pagination').html(Pagination);
                        $data.find("script").each(function(){
                            eval($(this).text());
                        });
                        window.history.pushState({},"", ajaxurl);
                        if (PagenationContainer.find('ul.pagination li.next a').length === 0) {
                            PagenationContainer.find('.more_goods').hide();
                        }
                    }
                });
            }
            return false;
        });
    }
    initPagination();
});

/* End */
